  return (
    <React.Fragment>
    {/* <div className="bg-img"></div> */}
    <div className="container-fluid bg-img d-flex justify-content-center align-items-center">
      <div className="row">
      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12 text-white">
                <h3 className="home_title">Hi, I'm <span>Vani Majjari</span></h3>
                <p className="home_desc">Front-end developer</p>
